const sleep = ms => new Promise((resolve, reject) => setTimeout(resolve, ms))
let nonceSign = parcel.getFeatureById('nonce1')
let timeSign = parcel.getFeatureById('timeSign')
let flags = Array(4).fill().map((v, i) => parcel.getFeatureById(`flag${i + 1}`))

let letters = Array(9)
  .fill()
  .map((v, i) => `https://assets.satoshidao.link/cv/a${i +
  1}.png`)

async function main () {
  while (true) {
    try {
      await nonceUpdate()
      await letterUpdate()
    } catch (e) {
      console.error('error to update scene', e.stack)
      throw e
    }
    await sleep(5000)
  }
};main()

async function letterUpdate () {
  let resp = await fetch('https://api-dev.satoshidao.link/letterActivity/dataFeed')
  let data = await resp.json()
  console.log(data.answers)
  for (let i = 0; i < 4; i++) {
    let url = letters[data.answers[i] - 1]
    if (url !== flags[i].get('url')) {
      flags[i].set({ url })
    }
  }
}

async function nonceUpdate () {
  let resp = await fetch('https://api-dev.satoshidao.link/merkleActivity/dataFeed')
  let data = await resp.json()
  let text = data.answers[0]
  if (text !== nonceSign.get('text')) {
    nonceSign.set({ text })
  }
   text = new Date(new Date(data.timestamp*1000)-0-new Date().getTimezoneOffset()*60000).toISOString().replace('T',' ').replace('.000Z','')
  if (text !== timeSign.get('text')) {
    timeSign.set({ text })
  }
}
